import React, { useEffect } from 'react';
import './Style.css';

const Test = ({tests, setTests}) => {
    useEffect(() => {
        const getAllTests = async () => {
            const requestOptions = {
                method: 'GET'
            }
            return await fetch("https://localhost:7036/api/Test/list",
            requestOptions)
            .then(Response => Response.json())
            .then(
                (data) => {
                    console.log('Data:',data)
                    setTests(data)
                },
                (error) => {
                    console.log(error)
                }
            )
        }
        getAllTests();
    }, [setTests]);

    return (
        <React.Fragment>
            <h1>List of Tests</h1>
            {
                tests.map(({testId, name, questions}) => (
                    <div className="Test" key={testId} id={testId}>
                        <strong> {testId}:{name} </strong>
                        {questions.map(({questionId, text}) => (
                            <div className="TestElement" key={questionId} id={questionId}>
                                {name}
                            </div>
                        ))
                        }
                    </div>
                ))
            }
        </React.Fragment>
    );
}
export default Test
